import React, { useEffect } from "react";
import Navbar from "../../components/Navbar";
// formik
import { Formik, Field, Form } from "formik";

function Login() {
  useEffect(() => {
    document.title = "Admin | Login";
  });

  return (
    <div className="min-h-screen max-w-2xl mx-auto font-inter">
      <Navbar />
      <div className="px-6 py-12 mt-16">
        <Formik
          initialValues={{ name: "", email: "" }}
          onSubmit={async (values) => {
            await new Promise((resolve) => setTimeout(resolve, 500));
            alert(JSON.stringify(values, null, 2));
          }}
        >
          <Form className="flex flex-col space-y-4 max-w-[400px] mx-auto p-4 bg-gray-100 dark:bg-black dark:border-[1px] dark:border-gray-700 rounded-xl">
            <div className="w-full">
              <Field name="name" type="text" className="w-full px-3 py-2 outline-none rounded" autoComplete="off" />
            </div>
            <div className="w-full">
              <Field name="email" type="email" className="w-full px-3 py-2 outline-none rounded" autoComplete="off" />
            </div>
            <button
              type="submit"
              className="px-8 py-3 text-black dark:text-white border rounded-lg"
            >
              Submit
            </button>
          </Form>
        </Formik>
      </div>
    </div>
  );
}

export default Login;
